import React, { Component } from 'react';
import axios from 'axios';
import DataTable from './data-table';

export default class Models extends Component {
    state = {
        users: [],
        isLoading: true,
        errors: null
      };
    
      getUsers() {
        axios
          .get("https://api.models.com/prosearch/sitesearch19-json.html?mdcsearch=ce")
          .then(response =>
            response.data.people.map(user => ({
              slug: `${user.slug}`,
              name: `${user.name}`,
              type: `${user.type}`,
              image: `${user.image}`
            }))
          )
          .then(users => {
            this.setState({
              users,
              isLoading: false
            });
          })
          .catch(error => this.setState({ error, isLoading: false }));
      }
    
      componentDidMount() {
        this.getUsers();
      }
    
      render() {
        const { isLoading, users } = this.state;
        return (
          <React.Fragment>
              
            <h2>Models</h2>
            <div class="container">
                <div class="row">
              {!isLoading ? (
                users.map(user => {
                  const { slug, name, type, image } = user;
                  return (
                    <div key={name}>
                      <p>{name}</p>
                      <div>
                        <img src={'https://i.mdel.net/i/db/'+image} alt={name} />
                      </div>
                      <p>{type}</p>
                      <hr />
                    </div>
                  );
                })
              ) : (
                <p>Loading...</p>
              )}
              </div>
            </div>
          </React.Fragment>
        );
      
    }
}
